		};
		btns.push(pBtn(item.btn.target, item.btn.icon, item.btn.text));
		views.push(pView(content, item.btn.target));
	});
	let _header = pHeader(btns);
	let _body = pBody(views);
	return pContainer(_header, _body);
};

(function () {
	hjs(App(), '#app');
})();

